GameData["ui_ext"]["ui_info"]["help_text_list"]["text_01"] = [[$16003801]] -- - Daemon Primarch, the supreme personification of chaos and destruction, unstoppable unique Greater Daemon hero.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_02"] = [[$16003802]] -- - No other Relic unit or Daemon Lord can be summoned once Angron is present; occupies the full Greater Daemon Cap!
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_03"] = [[$16003803]] -- - Wields many devastating abilities, he is not affected by covers, has very high regeneration.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_04"] = [[$16003804]] -- - He can summon anyone of four mighty swords, that suits his desire of destruction and mayhem.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_05"] = [[$16003805]] -- - Can use his huge wings to fly to almost any location in the battlefield, regardless range.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_06"] = [[$16003806]] -- - Cannot be deepstriked or use Infernal Rift Portals, and he can only be summoned directly from a Warp Gate.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_07"] = [[$16003807]] -- - NOTE: Can be summoned only once per battle, and will not remain for long as he soon loses interest and departs.
GameData["ui_ext"]["ui_info"]["help_text_list"]["text_08"] = [[$16003808]] -- - Extremely effective against all targets, the deadliest and ultimate close combat warrior.
